import React from 'react';
import './style.scss';
import ProfileImage from '../../assets/image/profile.svg';
import { Container, Row,Col,Image,Dropdown,DropdownButton } from 'react-bootstrap';
export function Profile(){
    return(
        <div className="conatainer">
            <h1>User Profile</h1>
            <Image src={ProfileImage} className="image" alt="Logo"/>
        </div>
    )
}

export class Home extends React.Component{
    constructor(props) {
      super(props);
      this.state = {
        isLogginActive: true
      };
    }
    render() {
        return (
        
              <Container fluid={true}>
              <Col>
                  <Row xl={12} className=" jumbo home-title" >
                      <Col xl={6} className="heading">
                          <p>
                              Buy fresh fruits <span><br></br>& vegitable</span>
                              <Search />
                          </p>
                      </Col>               
                      <Col xl={6}>
                          <Image src={Veg} className="image" alt="Logo"/>
                      </Col>
                  </Row>
                  <Col xl={12}>
                    <Topdeals />
                  </Col>
              </Col>
            </Container>
              );
    }
  }
